func findMissingAndRepeatedValues(grid [][]int) []int {
    n := len(grid)
    countMap := make(map[int]int)
    result := make([]int, 2)

    // Iterate over the grid and count occurrences of each number
    for i := 0; i < n; i++ {
        for j := 0; j < n; j++ {
            countMap[grid[i][j]]++
        }
    }

    // Find the repeated and missing numbers
    for i := 1; i <= n*n; i++ {
        if count, found := countMap[i]; !found {
            // Missing number
            result[1] = i
        } else if count == 2 {
            // Repeated number
            result[0] = i
        }
    }

    return result
}
